import React from "react";
import Tag from '../Tag';

export default function TagBox (props) {
  return (
    <div class="col-md-3">
        <div class="sidebar">
            <p>Popular Tags</p>
            <div class="tag-list">
                <Tag/>
            </div>
        </div>
    </div>
  );
};
